import { BrowserRouter as Router, Route } from "react-router-dom";
import { Home } from "./Components/Home/Home.js";

function App() {
    window.onscroll = () => {
        console.log("Hello")
    }
    return (
        <Router>
          <Route path={"/"} exact={ true } component={ Home }/>
        </Router>
    );
}

export default App;
